import { useState } from "react";

export default function Todo({
    text,
    isCompleted
}) {
    let classes = 'todo-action'; isCompleted ? '' : '';
    return (
        <tr className="todo">
            <td>{text}</td>
            <td>{isCompleted ? 'Done' : 'In Progress'}</td>
            <td className="todo-action">
                <button className="btn todo-btn">Change status</button>
            </td>
        </tr>
    );
}
